import React from 'react';
import './test.css';

class Homepage extends React.Component{

  render() {
    return <div>
        <h2>
          <img src="https://bit.ly/37wXEkG" alt="red angry bird" float="left" width="30" height="50"/>
          Welcome to Twitter 
        </h2>
    </div>
  }

}

export default Homepage;
